import './App.css';
import {Route, Routes} from 'react-router-dom';
import Navbar from './Components/Navbar';
import MatchSummary from './Components/MatchSummary';
import PlayerPerformance from './Components/PlayerPerformance';
import VirtualAssistant from './Components/VirtualAssistant';
import VirtualCommentator from './Components/VirtualCommentator';
import Chatbot from 'react-chatbot-kit';
function App() { 
  return (
    <div className="App">      
      <Navbar/>
      <Routes>
        <Route path="/" element={MatchSummary}/>
        <Route path="/PlayerPerformance" element={PlayerPerformance}/>
        <Route path="/VirtualAssistant" element={VirtualAssistant}/>
        <Route path="/VirtualCommentator" element={VirtualCommentator}/>
        <Route path="/Chatbot" element={Chatbot}/>

      </Routes>
    </div>
  );
}

export default App;
